const INITIAL_STATE = {
    data:{}
}

export default function DevicesDataReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case "FETCH_DEVICES_DATA":
      // console.log("FETCH_DEVICES_DATA")
      console.log(action.payload.options)
      // console.log(state);
      // state.data=[]
      // if (state.data.length<11) {
        // console.log(state.data.data);
        return {  data: {...state.data, asset:[action.payload]} }
      // }

    default:
      return state;
  }
}
